{
    "type": "object",
    "properties": {
        "price": {
            "type": "integer",
            "title": "定价",
            "description": "家教的设定加个，多少元/小时"
        },
        "sch_level": {
            "type": "string",
            "title": "学校层次",
            "description": "想要找到家教的层次，可以为jbw、eyy、syl、yb、eb，分别对应酒吧舞、二幺幺、双一流、一本、二本"
        },
        "stu_level": {
            "type": "string",
            "title": "学生水平",
            "description": "ABCDE，五档水平"
        },
        "subject": {
            "type": "string",
            "title": "科目",
            "description": "想要补课的科目"
        },
        "online": {
            "type": "boolean",
            "title": "线上",
            "description": "线上或者线下的形式，线上是true，线下是false"
        },
        "detail": {
            "type": "string",
            "title": "描述细节",
            "description": "300字以内的描述细节"
        },
        "days": {
            "type": "array",
            "items": {
                "type": "string"
            },
            "title": "星期几",
            "description": "记录星期几"
        },
        "time_num": {
            "type": "string",
            "title": "招聘信息中设置的时间数量",
            "description": "有几个时间这个字段就设置成多少"
        },
        "start_times": {
            "type": "array",
            "items": {
                "type": "string"
            },
            "title": "开始时间",
            "description": "记录时间"
        },
        "end_times": {
            "type": "array",
            "items": {
                "type": "string"
            },
            "title": "结束时间"
        }
    },
    "x-apifox-orders": [
        "price",
        "sch_level",
        "stu_level",
        "subject",
        "online",
        "detail",
        "time_num",
        "days",
        "start_times",
        "end_times"
    ],
    "required": [
        "price",
        "sch_level",
        "stu_level",
        "subject",
        "online",
        "detail",
        "time_num",
        "start_times",
        "days",
        "end_times"
    ]
}

